// App.js
import React from 'react';
import ResumeForm from './components/ResumeForm';
import './index.css';

function App() {
  return (
    <div className="min-h-screen bg-gray-100">
      {/* Header Section */}
      <header className="bg-blue-50 py-6 shadow-md">
        <div className="text-center">
          <h1 className="text-4xl font-bold text-blue-600 flex justify-center items-center gap-4">
            <img
              src="https://cdn-icons-png.flaticon.com/512/1087/1087815.png"
              alt="icon"
              className="w-01 h-10"
            />
            Resume Editor
          </h1>

          {/* Navigation Links */}
          <nav className="mt-4 flex justify-center gap-10 text-blue-700 text-lg font-medium">
            <a href="#name" className="hover:underline">Name</a>
            <a href="#experience" className="hover:underline">Experience</a>
            <a href="#education" className="hover:underline">Education</a>
            <a href="#skills" className="hover:underline">Skills</a>
          </nav>
        </div>
      </header>

      {/* Resume Form Section */}
      <div className="max-w-4xl mx-auto bg-white shadow-lg rounded-lg p-6 mt-8">
        <ResumeForm />
      </div>
    </div>
  );
}

export default App;
